contracts/Ecommerce.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity ^0.8.17;

contract Ecommerce {

    int public revenue;
    string public ownerName;
    address owner;

    struct product {
        uint productNo;
        string prodName;
        int noItem;
        int unitCost;
        uint totalPurchase;
    }

    struct refundInfo {
        address customer;
        uint id;
        int noItem;
    }

    mapping(address => int) individualSpend;
    mapping(uint => int) individualProduct;
    refundInfo[] private refundlist;  // Changed to private for gas efficiency

    product[] private productList;  // Changed to private for gas efficiency
    uint public totalProducts;

    constructor() {
        ownerName = "Shahid";
        owner = msg.sender;
        revenue = 0;
        totalProducts = 0;
    }

    // Add a new product with auto-generated id
    function addProduct(string memory name, int num, int cost) public {
        require(msg.sender == owner, "You are not authorized");
        uint id = productList.length;  // Auto-incrementing product ID
        product memory newProduct = product(id, name, num, cost, 0);
        productList.push(newProduct);
        totalProducts += 1;
    }

    // Purchase a product
    function purchaseItem(uint id, int quant) public payable {
        require(productList[id].noItem >= quant, "Out of stock");
        productList[id].noItem -= quant;
        int cost = productList[id].unitCost * quant;
        require(int(msg.value) >= cost, "Insufficient balance");
        (bool sent, ) = owner.call{value: uint(cost)}("");
        require(sent, "Failed to send Ether");
        revenue += cost;
        productList[id].totalPurchase += 1;
        individualSpend[msg.sender] += cost;
        individualProduct[id] += quant;
    }

    // Change price of a product
    function changePrice(uint id, int price) public {
        require(msg.sender == owner, "You are not authorized");
        productList[id].unitCost += price;
    }

    // Add more items to a product
    function addItem(uint id, int quant) public {
        require(msg.sender == owner, "You are not authorized");
        productList[id].noItem += quant;
    }

    // Get the account's total spend history
    function getAccountHistory(address addr) public view returns (int) {
        return individualSpend[addr];
    }

    // Get the product's purchase history
    function getProductHistory(uint id) public view returns (int) {
        return individualProduct[id];
    }

    // Request a product return
    function requestReturn(uint id, int quant) public {
        refundInfo memory myRefund = refundInfo(msg.sender, id, quant);
        refundlist.push(myRefund);
    }

    // Accept a product return and send Ether back to the customer
    function acceptReturn(uint refundIndex) public payable {
        require(msg.sender == owner, "You are not authorized");
        address refAddress = refundlist[refundIndex].customer;
        uint prodId = refundlist[refundIndex].id;
        int quant = refundlist[refundIndex].noItem;
        int amount = productList[prodId].unitCost * quant;
        require(int(msg.value) >= amount, "Insufficient Ether sent");
        (bool sent, ) = refAddress.call{value: uint(amount)}("");
        require(sent, "Failed to send Ether");
        productList[prodId].noItem += quant;
    }
    // Get details of all products
   function getProducts() public view returns (product[] memory) {

    return productList;
}



    // Get total number of products (automatically generated getter)
    function getTotalProducts() public view returns (uint) {

        return totalProducts;
    }
}

